  return (
    <section className="newsletter-container">
      <div className="container-fluid">
        <h2>Subscribe to Our Newsletter</h2>
        <form>
          <input type="email" placeholder="Enter your email" />
          <button className="btn btn-fill" type="submit">
            Subscribe
          </button>
        </form>
      </div>
    </section>
  );
}
